  const [user, setUser] = useState({})

  const handleChange = (e) => {
    setUser({
      [e.target.name]: e.target.value
    })
  }

  function logUserIn() {
    axios.get('http://localhost:5000/user/login', user)
    .then(res => {
    })
  }

  return (
    <div id='Login' className='homeTab' style={{display: 'none'}}>
      <input type='text' name='email' placeholder='Email' onChange={handleChange}></input>
      <input type='password' name='password' placeholder='Password' onChange={handleChange}></input>
      <button onClick={() => props.logUserIn(user)}>Login</button>
    </div>
  )
}

const mapDispatchToProps = (dispatch) => {
  return {
    logUserIn: (user) => dispatch(actionCreators.logUserIn(user))
  }
}

